import React from 'react';
import { Container, Row, Col } from 'reactstrap';
import blank from "../../assets/images/shirt-base.png";

const CreateFromPicture = () =>{
    console.log(blank)
    return (
        // <h1> No Search results. Maybe use a Scotty?</h1>
        <Container>
            <Row>
                <Col>

                </Col>
                <img style={{ width: '100%' }} src={blank}></img>
                <Col>
                <input type="text" value="Search for pictures" size="60"></input>
                <button>Search</button>
                </Col>
            </Row>
        </Container>
    );
};
export default CreateFromPicture
